import {
  Grid,
  Button,
  Container,
  Stack,
  Typography,
  TextField,
  Divider,
  Card
} from '@mui/material';
// components

import { alpha, styled } from '@mui/material/styles';
import Page from '../../components/Page';

const RootStyle = styled(Card)(({ theme }) => ({
  boxShadow: 'none',
  textAlign: 'center',
  padding: theme.spacing(3, 0),
  color: '#000000',
  backgroundColor: '#eed202'
}));
export default function AppTemperatureGrids() {
  return (
    <RootStyle>
      <Container maxWidth="xl" overflow="hidden">
        <Grid container spacing={{ xs: 0 }} columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}>
          <Grid
            item
            xs={12}
            md={6}
            lg={2}
            align="center"
            style={{ backgroundColor: 'red', padding: (5, 15) }}
          >
            <Typography
              variant="h4"
              gutterBottom
              style={{ color: '#45a29e', borderRadius: '50px' }}
            >
              Current Temperature:
            </Typography>
          </Grid>
          <Grid item xs={12} md={6} lg={2} align="center" style={{ backgroundColor: 'red' }}>
            <Typography variant="h4" gutterBottom style={{ color: '#45a29e' }}>
              minimum Temperature:
            </Typography>
          </Grid>
          <Grid item xs={12} md={6} lg={2} align="center" style={{ backgroundColor: 'red' }}>
            <Typography variant="h4" gutterBottom style={{ color: '#45a29e' }}>
              Average Temperature:
            </Typography>
          </Grid>
          <Grid item xs={12} md={6} lg={2} align="center" style={{ backgroundColor: 'red' }}>
            <Typography variant="h4" gutterBottom style={{ color: '#45a29e' }}>
              Maximum Temperature:
            </Typography>
          </Grid>
        </Grid>
      </Container>
    </RootStyle>
  );
}
